import axios from "axios";
import { useEffect, useState } from "react";
import { useNavigate, useParams } from "react-router-dom";
import Swal from "sweetalert2";

const URI = 'http://localhost:8000/oneDeportivo/';
const updURI = 'http://localhost:8000/updateDeportivo/';

const CompEditDeportivo = () => {
    const navigate = useNavigate();
    const { ID_Deportivo } = useParams();
    const [Nombre, setNombre] = useState('');
    const [Acepta_Mascotas, setAceptaMascotas] = useState('');
    const [Tienda, setTienda] = useState('');
    const [Vestidores, setVestidores] = useState('');
    const [Regaderas, setRegaderas] = useState('');
    const [Médico, setMédico] = useState('');
    const [formErrors, setFormErrors] = useState({
        nombre: ''
    });

    const update = async (e) => {
        e.preventDefault();
        const isValid = validateForm();
        if (isValid) {
            await axios.put(updURI + ID_Deportivo, {
                Nombre: Nombre,
                Acepta_Mascotas: Acepta_Mascotas,
                Tienda: Tienda,
                Vestidores: Vestidores,
                Regaderas: Regaderas,
                Médico: Médico
            });
            showSuccessAlert("Información general del deportivo editada")
            navigate('/showDeportivos/admin/null');
        }
    };

    //Obtenemos información previa antes ded editar
    const getDeportivoById = async () => {
        try {
            const res = await axios.get(URI + ID_Deportivo);
            setNombre(res.data.Nombre || '');
            setAceptaMascotas(res.data.Acepta_Mascotas || '');
            setTienda(res.data.Tienda || '');
            setVestidores(res.data.Vestidores || '');
            setRegaderas(res.data.Regaderas || '');
            setMédico(res.data.Médico || '');
        } catch (error) {
            showErrorAlert("Error al obtener datos", error);
        }
    };

    useEffect(() => {
        getDeportivoById();
    }, []);

    const showErrorAlert = (message) => {
        Swal.fire({
            icon: 'error',
            title: 'Error',
            text: message,
            confirmButtonText: 'OK'
        });
    };

    const showSuccessAlert = (message) => {
        Swal.fire({
            icon: 'success',
            title: 'Éxito',
            text: message,
            confirmButtonText: 'OK'
        });
    }; 

    const validateForm = () => {
        let valid = true;
        const errors = {
            nombre: ''
        };

        if (!Nombre) {
            errors.nombre = "El nombre es requerido";
            valid = false;
        }

        setFormErrors(errors);
        return valid;
    };

    return (
        <div className="formulario">
            <h1>Editar Deportivo</h1>
            <form onSubmit={update}>
                <div className="form-group">
                    <label>Nombre</label>
                    <input type="text" value={Nombre} onChange={(e) => setNombre(e.target.value)} className={`form-control ${formErrors.nombre && 'is-invalid'}`} />
                    {formErrors.nombre && <div className="invalid-feedback">{formErrors.nombre}</div>}
                </div>
        
                <div className="form-group">
                    <label>¿Acepta Mascotas?</label>
                    <input type="checkbox" checked={Acepta_Mascotas} onChange={(e) => setAceptaMascotas(e.target.checked)} />
                    <label>¿Tiene Tienda?</label>
                    <input type="checkbox" checked={Tienda} onChange={(e) => setTienda(e.target.checked)} />
                    <label>¿Tiene Vestidores?</label>
                    <input type="checkbox" checked={Vestidores} onChange={(e) => setVestidores(e.target.checked)} />
                    <label>¿Tiene Regaderas?</label>
                    <input type="checkbox" checked={Regaderas} onChange={(e) => setRegaderas(e.target.checked)} />
                    <label>¿Hay Médico?</label>
                    <input type="checkbox" checked={Médico} onChange={(e) => setMédico(e.target.checked)} />
                                
                </div>
                <button type="submit" className="btn btn-primary">Actualizar Deportivo</button>
            </form>
        </div>
    );
}

export default CompEditDeportivo;
